import React from 'react';
import './Projects.css'
import {
  MDBEdgeHeader,
  MDBFreeBird,
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBJumbotron,
  MDBIcon,
  MDBAnimation,
  MDBCard
} from 'mdbreact';
//import MenuLink from '../components/menuLink';

const CSSPage = () => {
  return (
    <>
    <MDBEdgeHeader color='indigo' className='sectionPage' />
	  <MDBFreeBird className="freebird">
      <MDBAnimation type='fadeInUp' duration='1000ms'>
		  <h1 className='display-3 font-weight-bold text-center'>Projects</h1>
      </MDBAnimation>
	  </MDBFreeBird>

        <MDBContainer>
          <MDBRow>
            <MDBCol md='8' className='mx-auto'>
                <MDBJumbotron className='mt-3'>
                  <h1 className='text-center'>
                    <MDBIcon icon='css3' brand className='indigo-text mr-w' />
                    CSS
                  </h1>
                  <ul className='list-unstyled example-components-list'>
                    <h6 className='mt-3 grey-text'><strong>FREE</strong></h6>
                  </ul>
                </MDBJumbotron>
            </MDBCol>
          </MDBRow>
        </MDBContainer>
    </>
  );
};

export default CSSPage;
